features.script:
let b = parcel.getFeatureById('door')
let collide=true
b.set({collidable:true})

feature.on('click',e=>{
  if(collide){
    b.set({collidable:false})
    collide=!collide
    b.rotation.y=0
    b.position.z=b.position.z+1
  }else{
    b.set({collidable:true})
    collide=!collide
    b.rotation.y=1.57
    b.position.z=b.position.z-1
  }

})
